public class InnerLogDeliveryConfigurationLogConfigurationFactory(Action<Humidifier.Cognito.LogDeliveryConfigurationTypes.LogConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Cognito.LogDeliveryConfigurationTypes.LogConfiguration>
{

    internal InnerLogDeliveryConfigurationFirehoseConfigurationFactory FirehoseConfigurationFactory { get; set; }

    internal InnerLogDeliveryConfigurationS3ConfigurationFactory S3ConfigurationFactory { get; set; }

    internal InnerLogDeliveryConfigurationCloudWatchLogsConfigurationFactory CloudWatchLogsConfigurationFactory { get; set; }

    protected override Humidifier.Cognito.LogDeliveryConfigurationTypes.LogConfiguration Create()
    {
        var logConfigurationResult = CreateLogConfiguration();
        factoryAction?.Invoke(logConfigurationResult);

        return logConfigurationResult;
    }

    private Humidifier.Cognito.LogDeliveryConfigurationTypes.LogConfiguration CreateLogConfiguration()
    {
        var logConfigurationResult = new Humidifier.Cognito.LogDeliveryConfigurationTypes.LogConfiguration();

        return logConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Cognito.LogDeliveryConfigurationTypes.LogConfiguration result)
    {
        base.CreateChildren(result);

        result.FirehoseConfiguration ??= FirehoseConfigurationFactory?.Build();
        result.S3Configuration ??= S3ConfigurationFactory?.Build();
        result.CloudWatchLogsConfiguration ??= CloudWatchLogsConfigurationFactory?.Build();
    }

} // End Of Class

